import styles from '../pages_css/Home.css';
import Navbar from '../compenents/Navbar.js';
import Footer from '../compenents/Footer.js';
import Carousel from 'react-bootstrap/Carousel';
import { FaArrowLeft, FaArrowRight } from 'react-icons/fa'



const Home = () => {
  
  const CarouselData = [
    {
      headerText: null,
      subText: 'Sub Text One',
      image: 'https://picsum.photos/300/300',
    },
    {
      headerText: 'Header Text Two',
      subText: null,
      image: 'https://picsum.photos/1200/800',
    },
    {
      headerText: null,
      subText: null,
      image: 'https://picsum.photos/720/720',
    },
    {
      headerText: 'Header Text Four',
      subText: 'Sub Text Four',
      image: 'https://picsum.photos/1920/1080',
    },
    {
      headerText: 'Header Text Five',
      subText: 'Sub Text Five',
      image: 'https://picsum.photos/480/360',
    },
  ]
  
  return (
    <div className="home">

      <Navbar />
      
      <div className="quick_click_3">
        <div className="container">
          <a href="#" className="navbar-link Sneakersq-link">
            <div className="text-q">Sneakers</div>
          </a>

          <a href="#" className="navbar-link Shoesq-link">
            <div className="text-q">Shoes</div>
          </a>


          <a href="#" className="navbar-link Popularq-link">
            <div className="text-q">Popular brand</div>
          </a>
        </div>
      </div>


      <Carousel
              data={CarouselData}
              autoPlay={true}
              rightItem={<FaArrowRight />}
              leftItem={<FaArrowLeft />}
              animationDuration={3000}
              headerTextType="black"
              subTextType="white"
              size="normal"
      />








      <Footer />










    </div>
  );
};

export default Home;
